// App.js
import React from 'react';
import { BrowserRouter as Router, useNavigate } from 'react-router-dom';
import AppRoutes from './router/routes'; // Uvezite AppRoutes iz routes.js

function App() {
  return (
    <Router>
      <div>
        <h1>Aplikacija za Lov</h1>
        <NavigationButton to="/popis-bodova" label="Bodovi" />
        <NavigationButton to="/popis-divljaci" label="Divljac" />
        <AppRoutes /> {/* Koristite AppRoutes komponentu za prikaz rute */}
      </div>
    </Router>
  );
}

// Stvorite komponentu NavigationButton
function NavigationButton({ to, label }) {
  let navigate = useNavigate();

  function handleClick() {
    navigate(to);
  }

  return (
    <button onClick={handleClick}>{label}</button>
  );
}

export default App;
